s.aK(0,"Multiple shapes",new A.aYY(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/multiple_shapes_example.dart",'    An example with many hitboxes that move around on the screen and during\n    collisions they change color depending on what it is that they have collided\n    with. \n    \n    The snowman, the component built with three circles on top of each other, \n    works a little bit differently than the other components to show that you\n    can have multiple hitboxes within one component.\n    \n    On this example, you can "throw" the components by dragging them quickly in\n    any direction.\n  ')
s.aK(0,"Multiple worlds",new A.aYZ(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/multiple_worlds_example.dart","    This example shows how multiple worlds can have discrete collision\n    detection.\n    \n    The top two Embers live in one world and turn green when they collide and\n    the bottom two embers live in another world and turn red when they collide,\n    you can see that when one of the top ones collide with one of the bottom\n    ones, neither change their colors since they are in different worlds.\n  ")
s.aK(0,"QuadTree collision",new A.aZ_(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/quadtree_example.dart",'In this example the standard "Sweep and Prune" algorithm is replaced by  \n"Quad Tree". Quad Tree is often a more efficient approach of handling collisions,\nits efficiency is shown especially on huge maps with big amounts of collidable \ncomponents.\nSome bricks are highlighted when placed on an edge of a quadrant. It is\nimportant to understand that handling hitboxes on edges requires more\nresources.\nBlue lines visualize the quad tree\'s quadrant positions.\n\nUse WASD to move the player and use the mouse scroll to change zoom.\nHold direction button and press space to fire a bullet. \nNotice that bullet will fly above water but collides with bricks.\n\nAlso notice that creating a lot of bullets at once leads to generating new\nquadrants on the map since it becomes more than 25 objects in one quadrant.\n\nPress O button to rescan the tree and optimize it, removing unused quadrants.\n\nPress T button to toggle player to collide with other objects.\n  ')
s.aK(0,"Raycasting (light)",new A.aZ0(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_light_example.dart","In this example the raycast functionality is showcased by using it as a light\nsource, if you move the mouse around the canvas the rays will be cast from its\nlocation. You can also tap to create a permanent source of rays that wont move\nwith with mouse.\n  ")
s.aK(0,"Raycasting",new A.aZ1(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_example.dart","In this example the raycast functionality is showcased. The circle moves around\nand casts 10 rays and checks how far the nearest hitboxes are and naively moves\naround trying not to hit them.\n  ")
s.aK(0,"Raytracing",new A.aZ2(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raytrace_example.dart","In this example the raytrace functionality is showcased.\nClick to start sending out a ray which will bounce around to visualize how it\nworks. If you move the mouse around the canvas, rays and their reflections will\nbe moved rendered and if you click again some more objects that the rays can\nbounce on will appear.\n  ")
